package baidumapsdk.demo.asmewill;import java.io.Serializable;/** * Created by Administrator on 2017/6/14. */public class CityChildBean implements Serializable{    private String name;    private String city;    public CityChildBean(String city) {        this.city = city;    }    public CityChildBean(String name, String city) {        this.name = name;        this.city = city;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getCity() {        return city;    }    public void setCity(String city) {        this.city = city;    }}